import { LocalizedLink } from "gatsby-theme-i18n"

import {
  ProSidebar,
  Menu,
  MenuItem,
  SubMenu,
  SidebarContent,
} from "react-pro-sidebar"
const Sidebar = () => {
  return (
    <div className="demos-sidebar">
            <ProSidebar>
              <SidebarContent>
                <Menu>
                 
                </Menu>
              </SidebarContent>
            </ProSidebar>
          </div>
  );
};
export default Sidebar;
